import {
  TextInput,
  Textarea,
  SimpleGrid,
  Group,
  Title,
  Button,
} from "@mantine/core";
import { useForm } from "@mantine/form";

const ContactPage = () => {
  const form = useForm({
    initialValues: {
      name: "",
      email: "",
      subject: "",
      message: "",
    },
    validate: {
      email: (value) => {
        if (!value) return "Email is required";
      },
    },
  });

  return (
    <form action="">
      <Title>Contact Us</Title>
    </form>
  );
};

export default ContactPage;
